import React, {useEffect, useState} from 'react';
import './Styles/ID.css'; // Импортируйте CSS файл
import {useNavigate} from "react-router-dom";


const Id = () => {
    const [data, setData] = useState();
    useEffect(() => {
        jsonFromBack()
    }, []);
    const jsonFromBack=async () => {
        const response = await fetch('https://localhost:8080/api/programInfo/',{method:'GET',credentials:"include"})
        setData(await response.json())
    }
    return (
        <table border="1" cellPadding="5" cellSpacing="0">
            <thead>
            <tr>
                <th>Author</th>
                <th>Version</th>
                <th>Name</th>
            </tr>
            </thead>
            <tbody>
            {data.map((item, index) => (
                <tr key={index}>
                    <td>{item.Author}</td>
                    <td>{item.Version}</td>
                    <td>{item.Name}</td>
                </tr>
            ))}
            </tbody>
        </table>
    );
};

export default Id;
